def BaseMatrix(X,n):
    Bazine = np.zeros((n,n))
    for i in range(n):
        for j in range(0, i + 1):
            if (j == 0):
                Bazine[i][j] = 1
            if (i > 0 and j > 0 and j <= i):
                Bazine[i][j] = (X[i] - X[j - 1]) * Bazine[i][j - 1]
    return Bazine

def Chobysev(n,a,b):
    x = np.zeros((n))
    for i in range(n):
        x[i]=((b-a)/(2)) * np.cos((np.pi*(2*i+1))/(2*n)) + (b+a)/2
    return x


def getPoly(coeff,x):
    final_pol = np.polynomial.Polynomial([0.])  # our target polynomial
    n = coeff.shape[0]  # get number of coeffs
    for i in range(n):
        p = np.polynomial.Polynomial([1.])  # create a dummy polynomial
        for j in range(i):
            p_temp = np.polynomial.Polynomial([-x[j], 1.])  # (x - x_j)
            p = np.polymul(p, p_temp)  # multiply dummy with expression
        p *= coeff[i]  # apply coefficient
        final_pol = np.polyadd(final_pol, p)  # add to target polynomial
    p = np.flip(final_pol[0].coef, axis=0)
    print(p)
    return p

def getInterpolationFunction(p):
    fnc = ""
    n = p.size
    for i in range(n):
        if(i+1 == n):
            fnc += " {0:3.5f}".format(p[i])
        else:
            fnc += " {0:3.5f}*x^{1} +".format(p[i],n-i-1)
    return fnc

def SplineYs(y,x):
    n = x.size
    Y = np.zeros(n-2)
    d = np.zeros((n - 1))
    for i in range(n - 1):
        d[i] = x[i + 1] - x[i]
    for i in range(n-2):
        Y[i] = ((y[i+2]-y[i+1])/d[i+1])-((y[i+1]-y[i])/d[i])
    return  Y

def SplineMatrix(x):
    n = x.size
    d = np.zeros((n-1))
    for i in range(n-1):
        d[i] = x[i+1]-x[i]
    print("Di=")
    print(d)
    Matrica = np.zeros((n-2,n))
    for i in range(n-2):
        for j in range(i+1,i+2):
            Matrica[i][j-1] = d[i]/6
            Matrica[i][j] = (d[i]+d[i+1])/3
            Matrica[i][j+1] = d[i+1]/6
    return Matrica

def SplineMatrixLooseEnds(x):
    n = x.size
    d = np.zeros((n - 1))
    for i in range(n - 1):
        d[i] = x[i + 1] - x[i]
    Matrica = np.zeros((n - 2, n-2))
    for i in range(n - 2):
        for j in range(i, i + 1):
            if(i>0):
                Matrica[i][j - 1] = d[i]/6
            Matrica[i][j] = (d[i]+d[i+1])/3
            if(i+1!=n-2):
                Matrica[i][j + 1] = d[i+1]/6
    return Matrica

